#!/usr/bin/env python3


# Generated by 2.9.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    N, M = map(int, input().split())
    A = []
    for _ in range(N * 2):
        A.append(input())
    # score = [0] * (N * 2)
    v = []
    for i in range(N * 2):
        v.append((0, i))
    # print(v)
    
    for m in range(M):
        for nn in range(N):
            s1, i1 = v[2 * nn]
            s2, i2 = v[2 * nn + 1]
            # print(s1, i1)
            # print(s2, i2)
            # print(A[i1][m], )
            if (A[i1][m] == "P" and A[i2][m] == "C") or (A[i1][m] == "C" and A[i2][m] == "G") or (A[i1][m] == "G" and A[i2][m] == "P"):
                v[2 * nn + 1] = (s2 - 1, i2)
            elif (A[i1][m] == "P" and A[i2][m] == "G") or (A[i1][m] == "G" and A[i2][m] == "C") or (A[i1][m] == "C" and A[i2][m] == "P"):
                v[2 * nn] = (s1 - 1, i1)
        #     print(v)
        # print("==")
        v.sort()
    for i in range(N * 2):
        print(v[i][1] + 1)
    return

if __name__ == '__main__':
    main()
